Soeben passiert. 
Nach Monaten in der gefühlten Endlosschleife.
Keine Lust mehr, die gelesenen psychologischen und spirituellen Ratgeber nochmal durchzublättern. Keine Lust mehr, die zutreffenden Passagen - mit Eselsohren markiert, farbig unterstrichen und am Rand noch doppelt mit Ausrufezeichen versehen und persönlich kommentiert - nochmal zu überfliegen.
 
Heute war er da, dieser Moment. Keine Lust mehr.
Zu analysieren. Zu überdenken. Zu flüchten?
Blick nach vorn, wie Max Herre dieses Jahr zu Corona-Anfangszeiten so schön gesungen hat. (Neuauflage, isch waaiiiß!)
 
Was war, das war.
Und immer das Alte mit sich rumzuschleppen, hat ein Mordsgewicht.
Kein Wunder, dass nach all der Schlepperei die Schulter Mucken macht. Mein Päckchen, die meiner Eltern, meiner Großeltern,  Familie und das ein oder andere Päckchen, das man sich im Laufe der Zeit von sonstigen Weggefährten so auflädt. Und je nach Päckchen wird man die so schnell nicht los... 

Aus manchen Päckchen Geschenke zu machen - das ist die große Kunst. Geschenke für mich selbst oder für denjenigen, dem man sein Päckchen - schön verpackt, mit Schleifchen und Liebe - zurückgibt.
Auch anderen ihr eigenes Päckchen überhaupt zuzumuten, kann ein Geschenk sein, weil derjenige vielleicht zum ersten Mal merkt: Da ist jemand, der mir mein Päckchen zutraut.
 
Es ist, wies ist.
So einfach. So simple. – So verdammt schwer (zu akzeptieren) oftmals.
Die hohe Kunst des Loslassens. Vielleicht lern ich sie doch noch?
Es gibt Momente, da merke ich, ich bin auf jeden Fall auf dem Weg dahin.
Und wenn das Ziel auch noch nicht in Sicht ist, der Weg ergibt sich, die Sicht wird klarer. Mit jedem kleinen Schritt ein bisschen mehr. Und in der Zwischenzeit genieße ich die Aussicht.
 
Que sera, sera. Es wird, was ich draus mache. Es wird, was du draus machst. Lass uns was Schönes draus machen und Spaß dran haben.
 
