863;}i:211;a:1:{s:7:"caption";s:2184:"(🇬🇧): [*Swipe left to see all the pictures*]
With a wingspan of 2 meters, vision more than 8 times superior to ours and razor-sharp talons that are bigger than the claws of a Jaguar, the Black-chested buzzard-eagle (Geranoaetus melanoleucus) is the undeniable QUEEN of the Uruguayan skies.
And yes, female eagles are bigger and more agressive than males, that's why I said "QUEEN" and not "KING" 😉 #girlpower
However, as powerful as their might be at hunting, they are quite vulnerable to habitat loss, because pairs mate for life and lay eggs just ONCE EVERY TWO YEARS on the exact same nest, every single season. To destroy their habitat is to literally destroying their food supply and their nesting grounds, and so, obliging them to try and survive by hunting domestic animals, such as poultry, lambs, cats and even small dogs. In the end, these beautiful animals are shot and poisoned by farmers. Remember always to respect our natural ecosystems and the species of wildlife that depend on them to survive!
(🇪🇦): [*Desliza hacia la izquierda para ver todas las fotos*]
Con una envergadura de 2 metros, una vista más de 8 veces superior a la nuestra y talones afilados más grandes que las garras de un jaguar, el Águila mora (Geranoaetus melanoleucus) es la indiscutible REINA de los cielos uruguayos. Y sí, las águilas hembras son más grandes y agresivas que los machos, por eso dije "REINA" y no "REY" 😉 #poderfemenino Sin embargo, por muy poderosos que sean en la caza, son bastante vulnerables a la pérdida de hábitat, porque las parejas se aparean de por vida y ponen huevos UNA VEZ CADA DOS AÑOS en el mismo nido, cada temporada. Destruir su hábitat es literalmente destruir su suministro de alimentos y sus zonas de nidificación, y así obligarlos a intentar sobrevivir cazando animales domésticos, como aves de corral, corderos, gatos e incluso perros pequeños. Al final, estos hermosos animales terminan siendo disparados y envenenados por granjeros. ¡Recuerden respetar nuestros ecosistemas naturales y a los animales que de ellos dependen para sobrevivir! #blackchestedbuzzardeagle #geranoaetusmelanoleucus #uruguay🇺🇾 #southamerica";}i:212;a:1:{s:14:"comments_count";i:0;}i:213;a:1:{s:11:"likes_count";i:0;}i:214;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuQNL1gwGQ";}i:215;a:1:{s:5:"image";s:260:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118771903_1563471973858438_6489042878125788860_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=UMTKU5tXYNcAX8l4YAm&_nc_tp=15&oh=2d9125529823e80ee8c8a22080b96267&oe=5F7ABBD2";}i:216;a:1:{s:4:"type";s:7:"sidecar";}i:217;a:1:{s:8:"owner_id";i:2555371307;}i:218;a:1:{s:14:"owner_username";s:0:"";}i:219;a:1:{s:14:"owner_fullname";s:0:"";}i:220;a:1:{s:9:"owner_pic";s:0:"";}i:221;a:1:{s:2:"id";s:19:"2390919717284091296";}i:222;a:1:{s:10:"short_code";s:11:"CEuQNCzMhWg";}i:223;a:1:{s:12:"created_time";i:1599239862;}i:224;a:1:{s:7:"caption";s:512:"Mi gente linda me siento muy feliz y agradecida por haber trabajado con personas talentosas y con energía súper poderosa. 